      SELECT DISTINCT + ( + - COUNT ( * ) ) + COUNT ( * ) + - 9 AS col2 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1

outputs:
  - name: q8030.out
    data: |
      -9
